import React from 'react'
import { useEffect } from 'react'
import axios from 'axios';

function Elemento() {

    const [articoli, setArticoli] = useState([]);

    useEffect(() => {

        axios.get('https://localhost:3002').then((response)=>{

        setArticoli(response.data); //mi prende tutti gli articoli

        })
    }, []);


    const elenco = () =>{
        articoli.map((value,key)=>{

            return(
                <li>{value.nome}</li>                
            )
        })
    }


  return (
    <div>{elenco}</div>
  )
}

export default Elemento
